        body {
            margin: 0;

        .topnav {
            display: flex;
            justify-content: center;
            /* Center horizontally */
            align-items: center;
            background: rgba(0, 0, 0, 0.80);
            display: flex;
            height: 44px;
            padding: 0px 244px;
            justify-content: center;
            align-items: center;

        }

        .topnav ul {
            list-style-type: none;
            padding: 0;
            margin: 0;
            display: flex;
            /* Display the list items horizontally */
        }

        .topnav li {
            display: flex;
            /* Add this line to center text and icons vertically */
            align-items: center;
            /* Align text and icons vertically */
            color: #f2f2f2;
            text-align: center;
            padding: 14px;
            font-size: 17px;
            margin-right: 20px;
            /* Add spacing between items */
        }

        .icn {
            /* Add any specific styling for icons here */
            margin-right: 5px;
            /* Adjust the margin for spacing between icon and text */
        }

        .jhota {
            display: flex;
           
            height: 100px;
            padding: 0px 34px;
            justify-content: center;
            align-items: center;
            flex-shrink: 0;
        }
        .jhota ul {
            list-style-type: none;
            padding: 0;
            margin: 0;
            display: flex;
            /* Display the list items horizontally */
        }
        .jhota li{
            width: 38px;
            height: 54px;
            flex-shrink: 0;
             display: flex;
            /* Add this line to center text and icons vertically */
            align-items: center;
            /* Align text and icons vertically */
            text-align: center;
            padding: 14px;
            font-size: 17px;
            margin-right: 20px;
            justify-content: space-between;
        }
    </style>
